INSERT INTO `post` (`ID`, `Heading`, `Heading_Slug`, `Description`, `Dates`, `Status`, `Splash`) VALUES
(1, 'Notice of Registration', 'notice-of-registration', 'Dear Students,\r\n\r\n      All students are notified that the college has since Monday, 14th May, 2018 resume for the second semester 2017/2018 academic session. Registration has since then commenced. Registration is online. All students are required to do and complete online registration of their previous level before they can proceed on the online registration of their current level.\r\n\r\n      Registration closes on WEDNESDAY, 13th June, 2018; no extension, please. Late registration will attract payment of #1000 fine.\r\n\r\n\r\nThanks.\r\nProvost.', '24 May 2018', 'Active', 'This is to notify all students that your first semester result is out kindly login to your portal and check your results. Thanks'),
(2, 'Course Registration Procedure', 'course-registration-procedure', 'All students are required to complete their biodata form right from 100 Level by clicking on biodata button, then complete the form and submit. Go back to 100 Level, click on CLICK HERE button to start course registration from 100 Level (For students in 200 and 300 Level). All students in 200 and 300 Level are expected to have completed 100 Level first & second semester registrations, 200 Level & 300 Level first semester course registration respectively on or before 6th of June 2018. Second semester registration for 200 Level and 300 Level students will be automatically available and closes on the 13th of June 2018. \r\n\r\nNOTE: All students are mandated to use their  previously signed course registration forms to complete their online course registration.\r\n\r\n\r\nThanks\r\nProvost', '24 May 2018', 'Active', ''),
(3, 'Late Registration Notice', 'late-registration-notice', 'This is to notify all students that ONLINE REGISTRATION for the semester courses will be re-opened for the next two week i.e. Monday 25th of June, 2018 till mid-night (11 : 59pm) on the 2nd July, 2018.\r\n\r\nAll concerned students should pay the specify amount to the College Bursary for collection of their PIN at the registry.\r\n\r\n\r\n\r\n\r\nAdhere strictly\r\n\r\nSigned\r\nAg. Registrar', '22 June 2018', 'Active', ''),
(4, 'Notice of Registration', 'notice-of-registration-01', 'Dear Students,\r\n\r\n      All students are notified that the college has since Monday, 14th May, 2018 resume for the second semester 2017/2018 academic session. Registration has since then commenced. Registration is online. All students are required to do and complete online registration of their previous level before they can proceed on the online registration of their current level.\r\n\r\n      Registration closes on WEDNESDAY, 13th June, 2018; no extension, please. Late registration will attract payment of #1000 fine.\r\n\r\n\r\nThanks.\r\nProvost.', '24 May 2018', 'Active', 'This is to notify all students that your first semester result is out kindly login to your portal and check your results. Thanks');
